import React from "react";
import Heading from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";
import CreateArea from "./CreateArea";



function App(){
    return (<div>
    <Heading  />
    <CreateArea  />
    {notes.map(note => (  
        <Note
        key = {note.id}
        title = {note.title}
        content = {note.content}
         />
    ))}
    <Footer  />
    </div>);
}

export default App;
